import React from "react"


class ProfileStartus extends React.Component {

    StatusState = () => {
        editmode : false
    }

    render() {

        return (
            <div>
                {this.StatusState.OnMessageChange ?
                    <div>

                    <span>
                        {this.props.status}
                    </span>

                    </div>
                    :
                    <div>
                        <input value={this.props.status}/>
                    </div>
                }


            </div>
        )

    }
}

export default ProfileStartus
